import React from 'react';
import { menu_list } from '../assets/frontend_assets/assets';

const HorizontalScrollCard = () => {
  return (
    <div className='flex justify-between gap-8 items-center overflow-x-scroll scrollbar-hide px-5'>
      {menu_list.map((menu, index) => (
        <div key={index} className='shrink-0'>
          <img src={menu.menu_image} alt={menu.menu_name} className='mb-3' />
          <div className='text-center text-slate-700 font-semibold'>{menu.menu_name}</div>
        </div>
      ))}
    </div>
  );
}

export default HorizontalScrollCard;
